import React from "react";
import { Container, NavLink, Row, Col } from "react-bootstrap";
import icon4 from "../../icon4.png";
import icon5 from "../../icon5.png";
import icon6 from "../../icon6.png";
import icon7 from "../../icon7.png";
import "./Official.css";
const Official = () => {
  return (
    <div>
      <Container>
        <Row>
          <ul className="list">
            <Col sm={3} md={2} className="menu">
              <img src={icon4} alt="icon" className="icon" />
              <NavLink to="">Official stores</NavLink>{" "}
            </Col>
            <Col sm={3} md={2} className="menu1">
              <img src={icon5} alt="icon" className="icon" />{" "}
              <NavLink>Bleulet Global</NavLink>{" "}
            </Col>
            <Col sm={3} md={2} className="menu1">
              <img src={icon6} alt="icon" className="icon" />{" "}
              <NavLink>Buy Airtime</NavLink>{" "}
            </Col>
            <Col sm={3} md={2} className="menu1">
              <img src={icon7} alt="icon" className="icon" />{" "}
              <NavLink>Bluelet Prime</NavLink>{" "}
            </Col>
          </ul>
        </Row>
      </Container>
    </div>
  );
};

export default Official;
